body.div:
			 // κινεῖ δὲ ἡ ψυχὴ τὸ σῶμα οὐχ ὡς αὐτὴ κινουμένη τε καὶ οὕτω κινοῦσα
                            αὐτό (αὐτὴ γὰρ ἀκίνητος καθ᾿ αὑτήν), ἀλλ᾿ ὡς αἰτία τῷ ζῴῳ τῆς κινήσεως,
                            ὡς ἡ ἐνυπάρχουσα βαρύτης τῇ γῇ τῆς εἰς τὸ κάτω κινήσεως.

			//βουλόμενος δὲ τὸν νοῦν ἀθάνατον δεικνύναι καὶ φεύγειν τὰς ἀπορίας ἃς
                            ἐπιφέρουσιν τῷ θύραθεν νῷ ἀνάγκην ἔχοντι τόπον ἀλλάττειν, οὐ δυναμένῳ
                            δέ, εἴ γέ ἐστιν ἀσώματος, οὔτε ἐν τόπῳ εἶναι οὔτε

			 εἰ δέ, ὅπερ εὔλογον, χωρὶς τοῦ ἑτέρου θάτερον οἵα τε δέξασθαι (κατὰ γὰρ
                            ταὐτὸν ἀδύνατον), πῶς οὐκ ἔσται τὸ ὑποκείμενον θερμότητα καὶ ξηρότητα
                            ἔχον ἁπτόν;

			 τὸ δὲ τῆς ὄψεως σῶμα πῶς εἰς κῶνον πλατύνεται καὶ μείζονα ἐπὶ πλέον
                            προχωροῦν μήτε τῶν παχυτέρων μήτε τῶν λεπτοτέρων σωμάτων τοῦτο
                            πασχόντων;

			 ἔτι δὲ αἱ ἀκτῖνες αἱ ἐκπεμπόμεναι τί δή ποτε οὔτε ὑπὸ τῶν ἀνέμων οὔτε
                            ὑπὸ τῶν ὑδάτων τῶν κινουμένων περιφέρονται, ἀλλ᾿ ἐπ᾿ εὐθείας ἀεὶ καὶ
                            τούτων ὄντων ὁρῶμεν, εἰ ἡ ἐπιφάνεια τοῦ ὕδατος ἐν ταὐτῷ μένοι;

			 ἔτι εἰ πέφυκεν ὁ ἀὴρ οὕτως τυποῦσθαι, τί δή ποτε οὐχὶ καὶ ἀπελθόντος τοῦ
                            τυποῦντος ἔτι μένει ἐν αὐτῷ ἡ τύπωσις, ὥσπερ καὶ ἐπὶ τῶν ἄλλων, ὥστε καὶ
                            μὴ παρόντα τὰ ὁρατὰ ἐχρῆν ἡμᾶς ἔτι ὁρᾶν;

			 πῶς δὲ οἷόν τε καὶ τῶν σχημάτων καὶ τῶν μεγεθῶν ἀντίληψιν γίνεσθαι διὰ
                            τῶν εἰδώλων (ἃ βουλόμενοι σώζειν τὰ εἴδωλα ποιοῦσιν), εἴ γε κατὰ βραχὺ ἡ
                            ἔμπτωσις εἰς τὸν ὀφθαλμὸν αὐτῶν γίνεται;

			 πῶς δὲ εἰδώλου ὄντος τοῦ ἐν τῷ κατόπτρῳ εἴδωλα πάλιν ἀπορρεῖ τοσαῦτα,
                            καὶ διὰ τί τὰ ἐν τοῖς κατόπτροις εἴδωλα παχύτερα, ὡς τοσαύτην ἀπ᾿ αὐτῶν
                            ἀπορροὴν γίνεσθαι;

			 ἔτι τίς ἡ ἀνάμαξις τοῦ εἴδους, καὶ πῶς γίνεται τῷ ἐκπεμπομένῳ ἀπὸ τῆς
                            ὄψεως παρὰ τοῦ ἀπορρέοντος ἀπὸ τοῦ ὁρωμένου τύπωσις, ἀλλὰ οὐκ
                            ἀλλοίωσις;

			 ἔτι εἰ πρὸς τὴν τῶν κατὰ φύσιν ἐκλογὴν χρεία καὶ σώματος ὑγιαίνοντος καὶ
                            αἰσθήσεων, ἅ ἐστιν ἔξω τῆς ἀρετῆς (πῶς γὰρ ἄνευ τούτων κατὰ τρόπον ἂν
                            τῶν κατὰ φύσιν τὴν ἐκλογὴν ποιήσαιτο;

			 ἐν γὰρ τῇ χρήσει τῶν ἐκλεγομένων, οὐκ ἐν τῇ ἐκλογῇ τῶν ὑποκειμένων τὸ
                            τέλος, καὶ καθόλου πῶς οὐκ ἄτοπον τὸ τὴν ἀρετὴν ἐπὶ τοῦτο λέγειν εἶναι
                            μόνον, ἐπὶ τὸ ἐκλέγεσθαι;

			 οὐ γὰρ δὴ κακόν γε ἐροῦσιν αὐτόν εἰ μὲν οὖν ἀγαθόν, πρῶτον μὲν πῶς οὐχὶ
                            τὰ συμπληρωτικὰ αὐτοῦ καὶ ποιητικὰ ἀγαθὰ ἂν καὶ αὐτὰ εἴη, ὥστε ἀγαθὰ τὰ
                            προηγμένα;

			 καθόλου δέ, εἰ ἡ ἀρετὴ αὐτάρκης πρὸς τὸ παρασχέσθαι τὸν βίον ἡμῶν ἄκρως
                            εὐδαίμονα καὶ μακάριον, πῶς εὔλογος ἐξαγωγὴ τῷ τὴν ἀρετὴν ἔχοντι ἐν
                            μακαρίῳ βίῳ ὄντι;

			 ἔτι εἰ εὔλογος μὲν ἡ ἐξαγωγή, κωλυθείημεν δὲ ἐξάγειν ἑαυτοὺς ἀπό τινος,
                            πῶς οὐκ ἄθλιος ὁ βίος ἐν τοῖς τοιούτοις, δι᾿ ἃ ἦν εὔλογον ἐξάγειν
                            ἑαυτόν;
